import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import { SettingsNavbar } from './components';


class Contact extends Component {

  render() {
    return (
      <div>
        <SettingsNavbar />
        <div className="jumbotron">
            <h2>Nous contacter</h2>
        </div>
      </div>
    );
  }

}

export default Contact;
